INSERT INTO "PUBLIC"."news" VALUES
(1, U&'<h5>Admin-17 Cr\00e9er un Event (Task)</h5><div class="container-fluid">R\00e9sultat \00e0 visualiser : <a class="btn btn-primary" href="http://127.0.0.1:8080/gestion">Events</a></div>', TIMESTAMP '2023-11-06 10:00:00', 'Gestion des Events (US)', '/img/news/events.png'),
(2, U&'<h5>Guest-25 Consulter la liste des athl\00e8tes (par sport, par pays\2026)</h5><div class="container-fluid">R\00e9sultat \00e0 visualiser : <a class="btn btn-primary" href="http://127.0.0.1:8080/athletes">Athl\00e8tes</a></div>', TIMESTAMP '2023-10-25 10:00:00', U&'Gestion des Athl\00e8tes (US)', '/img/news/athletes.png'),
(3, U&'<h5>Guest-23 Consulter la page d\2019accueil</h5>', TIMESTAMP '2023-11-06 09:30:00', 'News sur Accueil', NULL),
(4, U&'Malgr\00e9 les nombreuses rumeurs venues de France et d''Espagne, il n''y aurait rien entre le Real Madrid et Kylian Mbapp\00e9. Aucune discussion n''a \00e9t\00e9 entam\00e9 et il faudra, vraisemblablement, attendre plusieurs mois pour conna\00eetre la d\00e9cision du joueur tricolore. Pour l''heure, toutes les options sont sur la table, notamment une prolongation au PSG.  L''ann\00e9e 2023 n''est pas encore termin\00e9e, mais les rumeurs sont nombreuses au sujet de l''avenir de Kylian Mbapp\00e9. Certains journalistes espagnols tiennent pour acquis son arriv\00e9e au Real Madrid l''ann\00e9e prochaine. Mais en r\00e9alit\00e9, le joueur du PSG n''a encore pris aucune d\00e9cision.', TIMESTAMP '2023-11-06 11:30:00', U&'Mbapp\00e9 - PSG', '/img/news/F-Lu0kJbgAAfik9.jpg');       
